import React from 'react'
import { Routes, Route, Link } from "react-router-dom";
import Hangman from './Hangman';



function App() {
  return (
    <div className="App">
      <Link to="/hangman">Hangman</Link>
      <Routes>
        <Route path="/hangman" element={<Hangman />}></Route>
      </Routes>
    </div>
  );
}

export default App;
